### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. Probability and Conditional Probability
- **Concepts**: Understanding basic probability and conditional probability.
- **Equations**:
  - \( P(A|B) = \frac{P(A \cap B)}{P(B)} \)

#### 2. Demand-Response Curve
- **Concepts**: Non-linear demand curves, latent demand, and optimal pricing.
- **Equations**:
  - Linear interpolation for demand estimation: \( D(p) = a - bp \)

#### 3. Linear Programming
- **Concepts**: Primal and dual formulations, binding and non-binding constraints, decision variables.
- **Equations**:
  - Primal Formulation:
    \[
    \text{Maximize } c^T x \text{ subject to } Ax \leq b, x \geq 0
    \]
  - Dual Formulation:
    \[
    \text{Minimize } b^T y \text{ subject to } A^T y \geq c, y \geq 0
    \]

#### 4. Logistic Regression and Confusion Matrix
- **Concepts**: Precision, recall, sensitivity, specificity, and accuracy.
- **Equations**:
  - Precision: \( \frac{TP}{TP + FP} \)
  - Recall (Sensitivity): \( \frac{TP}{TP + FN} \)
  - Specificity: \( \frac{TN}{TN + FP} \)
  - Accuracy: \( \frac{TP + TN}{TP + TN + FP + FN} \)

#### 5. Regression Analysis
- **Concepts**: ANOVA, regression statistics, coefficients, standard error, t-statistics.
- **Equations**:
  - Regression Line: \( y = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \ldots + \beta_n x_n \)
  - R-squared: \( R^2 = 1 - \frac{SS_{res}}{SS_{tot}} \)
  - Adjusted R-squared: \( \bar{R}^2 = 1 - \left( \frac{SS_{res}/(n-p)}{SS_{tot}/(n-1)} \right) \)

